import { CardComponent } from './gifs/components/card/card.component';
import { SearchBoxComponent } from './search-box/search-box.component';

@NgModule({
  declarations: [
    AppComponent,
    CardComponent,
    SearchBoxComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,

    GifsModule,
    SharedModule,
  ],
